let itemBody = document.getElementById("itemBody");
let grandTotalField = document.getElementById("grandTotal");

// Add new item row
function addItem() {
    let row = document.createElement("tr");

    row.innerHTML = `
        <td><input type="text" class="itemName" placeholder="Item Name"></td>
        <td><input type="number" class="qty" value="1" min="1" oninput="updateTotal(this)"></td>
        <td><input type="number" class="price" value="0" oninput="updateTotal(this)"></td>
        <td><input type="text" class="itemTotal" value="0" readonly></td>
        <td><button type="button" onclick="removeItem(this)">X</button></td>
    `;

    itemBody.appendChild(row);
}

// Update item total and grand total
function updateTotal(elem) {
    let row = elem.parentElement.parentElement;

    let qty = row.querySelector(".qty").value;
    let price = row.querySelector(".price").value;
    let total = row.querySelector(".itemTotal");

    total.value = qty * price;

    updateGrandTotal();
}

// Remove item
function removeItem(btn) {
    btn.parentElement.parentElement.remove();
    updateGrandTotal();
}

// Grand total
function updateGrandTotal() {
    let totals = document.querySelectorAll(".itemTotal");
    let sum = 0;

    totals.forEach(t => sum += Number(t.value));
    grandTotalField.value = sum;
}


